import React from 'react';
import v1 from '../'
import './Gallery.css';

const Gallery = () => {
    return (
        <section className="gallery">
            <h2>Gallery</h2>
            <div className="images">
                <img src="image1.jpg" alt="Virat Kohli 1" />
                <img src="image2.jpg" alt="Virat Kohli 2" />
                <img src="image3.jpg" alt="Virat Kohli 3" />
            </div>
        </section>
    );
};

export default Gallery;
